import React from 'react';
import { Box, Center, GluestackUIProvider, VStack, View } from '@gluestack-ui/themed';
import { config } from '@gluestack-ui/config';
import Loader from '../components/Loader';

export default function ViewNotePage() {
    return (
        <GluestackUIProvider config={config}>
            
  <ImageBackground
    source={{ uri: "https://legacy.reactjs.org/logo-og.png" }}
    style={{ flex: 1, justifyContent: "center" }}></ImageBackground>
            {/* <Loader /> */}
            <View backgroundColor='$primary0' flex={1}>
                <Center>
                    <Box justifyContent='center'>
                        <VStack p='$4' >
                            <Box w='$20' h='$20' bg='$blue300' />
                            <Box w='$20' h='$20' bg='$blue400' />
                            <Box w='$20' h='$20' bg='$blue500' />
                        </VStack>
                    </Box>
                </Center>
            </View>
        </GluestackUIProvider>
    );
}
